CREATE TABLE "URP_STU_COURSE"(
	"STU_NO" CHAR(8) NOT NULL, 
	"COURSE_NO" CHAR(8) NOT NULL, 
	"SCORE" NUMBER(3,0), 
	"INPUTTIME" DATE DEFAULT ((Sysdate)) NOT NULL,
	CONSTRAINT "PK_URP_STU_COURSE" PRIMARY KEY ("STU_NO", "COURSE_NO"),
	CONSTRAINT "FK_URP_STU_COURSE_COURSE_NO" FOREIGN KEY ("COURSE_NO") REFERENCES "URP_COURSE" ("COURSE_NO"),
	CONSTRAINT "FK_URP_STU_COURSE_STU_NO" FOREIGN KEY ("STU_NO") REFERENCES "URP_STUDENT" ("STU_NO")
);

